import { Component } from '@angular/core';
import { NgForm, FormControl, Validators } from '@angular/forms';
import { HttpClient } from '@angular/common/http';

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.css']
})
export class RegisterComponent {
  contrasenaControl = new FormControl('', [
    Validators.required,
    Validators.minLength(8),
    Validators.maxLength(20),
    Validators.pattern(
      /^(?=.*[a-z])(?=.*[A-Z])(?=.*\d)(?=.*[@$!%*?&])[A-Za-z\d@$!%*?&]+$/
    )
  ]);

  constructor(private http: HttpClient) {}

  registrarUsuario(form: NgForm) {
    if (form.invalid) {
      return;
    }

    const usuario = {
      nombre: form.value.nombre,
      contrasena: form.value.contraseña,
      sexo: form.value.sexo
    };

    this.http.post('https://localhost:7271/api/Usuario', usuario).subscribe(
      response => {
        console.log(response);
      },
      error => {
        console.log(error);
      }
    );
  }
}
<div class="container" style="margin-top: 30px; background-image: url('register.jpg'); background-size: cover; background-position: center;">
  <h2>Registro de Usuario</h2>
  <form (ngSubmit)="registrarUsuario(f)" #f="ngForm" style="background-color: rgba(255, 255, 255, 0.8); padding: 20px;">
    <div class="form-group">
      <label for="nombre">Nombre:</label>
      <input type="text" id="nombre" name="nombre" ngModel required class="form-control">
    </div>
    <div class="form-group">
      <label for="contraseña">Contraseña:</label>
      <input type="password" id="contraseña" name="contraseña" [formControl]="contrasenaControl" class="form-control">
      <div *ngIf="contrasenaControl.invalid && (contrasenaControl.dirty || contrasenaControl.touched)">
        <div *ngIf="contrasenaControl.hasError('required')" class="alert alert-danger">La contraseña es requerida.</div>
        <div *ngIf="contrasenaControl.hasError('minlength')" class="alert alert-danger">La contraseña debe tener al menos 8 caracteres.</div>
        <div *ngIf="contrasenaControl.hasError('maxlength')" class="alert alert-danger">La contraseña no puede tener más de 20 caracteres.</div>
        <div *ngIf="contrasenaControl.hasError('pattern')" class="alert alert-danger">La contraseña debe incluir al menos una mayúscula, una minúscula, un número y un carácter especial.</div>
      </div>
    </div>
    <div class="form-group">
      <label for="sexo">Sexo:</label>
      <select id="sexo" name="sexo" ngModel required class="form-control">
        <option value="">Seleccionar</option>
        <option value="Masculino">Masculino</option>
        <option value="Femenino">Femenino</option>
      </select>
    </div>
    <div class="form-group mt-4">
      <button type="submit" [disabled]="!f.valid || contrasenaControl.invalid" class="btn btn-primary btn-block">Registrar</button>
    </div>
  </form>
</div>
